import React from 'react';
import { useForm } from 'react-hook-form';

const AddDoctor = () => {
    const { register, handleSubmit } = useForm();
    const addADoctor = (data) =>{
        console.log(data);
    }
    return (
        <div className='SignUp'>
        <div className="flexible h-[700px]">
             <div className="card w-96 bg-base-100 shadow-xl">
                     <div className="card-body">
                         <h2 className="card-title font-light mx-auto my-3">Add a Doctor</h2>
                         <form onSubmit={handleSubmit(addADoctor)}>

                             <div className="form-control">
                                 <label className="label">
                                     <span className="label-text">Name</span>
                                 </label>
                                 <input type="text"{...register("name", {required: true, maxLength: 100})} />
                             </div>

                             <div className="form-control">
                                 <label className="label">
                                     <span className="label-text">Email</span>
                                 </label>
                                 <input type="email"  {...register("email", {
                                     required: {
                                         value:true,
                                         message:'Please type your email'
                                     },
                                     pattern: /[a-z0-9]+@[a-z]+\.[a-z]{2,3}/
                                     })} />
                             </div>
                             <div className="form-control">
                                 <label className="label">
                                     <span className="label-text">Password</span>
                                 </label>
                                 <input type="password" {...register("password", {})} required />
                             </div>
                             <button className='w-full my-3'>Add</button>
                         </form>
                     </div>
             </div>
        </div>
     </div>
    );
};

export default AddDoctor;
